/// Unicode→区点をバイナリ検索
pub fn unicodeToKanjiKuTen(codepoint: u21) ?struct { ku: u8, ten: u8 } {
    // バイナリ検索
    var left: usize = 0;
    var right: usize = kanji_unicode_to_jis.len;
    
    while (left < right) {
        const mid = left + (right - left) / 2;
        const entry = kanji_unicode_to_jis[mid];
        
        if (entry.unicode == codepoint) {
            return .{ .ku = entry.ku, .ten = entry.ten };
        } else if (entry.unicode < codepoint) {
            left = mid + 1;
        } else {
            right = mid;
        }
    }
    return null;
}

/// JIS区点→Unicodeを検索
pub fn kanjiJisToUnicode(ku: u8, ten: u8) ?u21 {
    if (ku < 16 or ku > 84 or ten < 1 or ten > 94) return null;
    const idx = (@as(usize, ku - 16) * 94) + @as(usize, ten - 1);
    const result = kanji_jis_to_unicode[idx];
    return if (result == 0) null else result;
}
